//pages/Nav.js
import React from "react";
import axios from "axios";
import HeaderMain from "../header/headerMain";
import TripSelection from "./tripSelection";
import TripNearby from "./tripNearby";
import Notice from "../notice/notice";
function ShowTripData() {
    let location = sessionStorage.getItem("location");

    console.log("loc : " + location)

    getDetailData();

    function getDetailData() {
        axios.get('http://210.115.227.82:18080/api/trip/info?loc=' + location)
            .then(function (response) {
                console.log(response.data.response);
            })
            .catch(function (error) {
                console.log(error);
            })
    }
    return (
        <div className="Tripselection">
        <div id="header">
            <HeaderMain />
            <HeaderMenu />
        </div>

        <div id="pagelists">
            <TripSelection />
        </div>

        <div id="tripPlaces">
            <TripNearby>
            </TripNearby>
        </div>

        <div id="NoticeSection">
            <Notice></Notice>
        </div>

    </div>

    );
}

export default ShowTripData;
